import { Link } from 'react-router-dom';
import ArtistsCard from "./ArtistsCard";

const dataFromSpotifyApi = [
    {name:"Travis Scott",
        genre:"Hip Hop",
        futureEvents: []
    },
    {name:"Mike Scott ",
        genre:"Hip Hop",
        futureEvents: []
    },
    {name:"Tony Stark",
        genre:"Iron Man",
        futureEvents: []
    },
    {name:"First last",
        genre:"Example genre",
        futureEvents: []
    }
]

function Artists(props) {
    return (
        <>
            <div class="row g-5 m-2" >

                {
dataFromSpotifyApi.map((name,genre,futureEvents) =>{
                <div class="col-xl-3">
                    <ArtistsCard ArtistsName={name} Genre={genre}/>

                </div>
                })}




            </div>
        </>
        // <div>
        //     <h2>Artists</h2>
        //     <p>Travis Scott, R Kelly, Taylor Swift, and More!!</p>
        // </div>
    );
}

export default Artists;
